def calculate_matches_won(A, N):
    lis = A.copy()
    dic = {rating: 1 for rating in A}
    if N % 2 == 0:
        dic[A[-1]] = 0
    while len(lis) > 1:
        j = 0
        mis = []
        while j + 1 < len(lis):
            if lis[j] < lis[j + 1]:
                mis.append(lis[j + 1])
            else:
                mis.append(lis[j])
            j += 2
        if len(lis) % 2 != 0:
            mis.append(lis[-1])
        lis = mis
        if len(lis) % 2 != 0:
            dic[lis[-1]] -= 1
        for i in lis:
            if i in dic:
                dic[i] += 1
    return [dic[rating] for rating in A]

